public class WordBreak {
    public boolean wordBreak(String s, Set<String> dict) {
        // write your code here
        if (s == null || s.length() == 0) {
            return true;
        }

        if (dict == null || dict.size() == 0) {
            return false;
        }

        return helper(s, dict);
    }

    private boolean helper(String s, Set<String> dict) {
        Queue<String> queue = new LinkedList<String>();
        Map<String, String> mapping = new HashMap<String, String>();

        for (String word : dict) {
            if (s.startsWith(word)) {
                queue.offer(word);
                mapping.put(word, s.replaceAll(word, ""));
            }
        }

        if (queue.isEmpty()) {
            return false;
        }

        int i = 0;
        while (!queue.isEmpty()) {
            String word = queue.poll();
            String leftString = mapping.get(word);
            if (dict.contains(leftString) || leftString.length() == 0) {
                return true;
            }
            for (String d : dict) {
                if (leftString.startsWith(d)) {
                    queue.offer(d);
                    mapping.put(d, leftString.replaceAll(d, ""));
                }
                System.out.println(++i);
            }
        }
        return false;
    }

    public static void main(String[] args) {
        WordBreak wb = new WordBreak();
        Set<String> dict = new HashSet<String>();
        dict.addAll(Arrays.asList(new String[]{"a", "b", "c", "d", "e", "f", "g"}));
//        dict.addAll(Arrays.asList(new String[]{"lint", "code"}));

        StringBuilder sb = new StringBuilder();
        sb.append("").append(
                "").append("");
//
//        sb.append("lintcode");
        System.out.println(wb.wordBreak(sb.toString(), dict));
    }
}
